import React from "react";
import ReactDOM from 'react-dom';

function App(props){
  return(
    <>
      <div className="cards">
        <div className="card">
          <img src={props.imgsrc} alt = "image" className="card___img"/>
          <div className="card___info">
            <span className="card___category"></span>
            <h3 className="card___title"></h3>
            <a href="" target="_blank"><button>Watch Now</button></a>
          </div>
        </div>
      </div>
    </>
  );
}

export default App;
